import React from 'react';
import './NateLauncher.css';

const NateLauncher = () => {
  return (
    <div className="nate-launcher">
      <h1>Download NateLauncher</h1>
      <p>Click the button below to download NateLauncher.</p>
      <a href="./storage/files/NateLauncher Insataller.exe" download className="download-button">Download</a>
    </div>
  );
};

export default NateLauncher;
